import React, { Component } from 'react'
import PropTypes from 'prop-types'

export default class Detnews extends Component {
  render() {
    const { title, imageUrl,author ,content} = this.props;
    return (
      <div>
        <div><h2>{title}</h2></div>
        <div><img src={imageUrl} alt="" /></div>
        <div>{content}</div>
        <p>{author}</p>
      </div>
    )
  }
}
